import "./photography.css";

const Photography = () => {
  return (
    <motion.div
    intial={{ opacity: 0 }}
    animate={{ opacity: 1 }}
    exit={{ opacity: 0 }}
  >
    <p>resimler</p>
  </motion.div>
  );
};
export default Photography;
